import React from 'react';
import '../assets/css/Calender.css';
import { Container, Row, Col } from 'react-bootstrap';

export default function Calender() {
  return (
    <div className='calender'>
        <h1>Horarios</h1>
        <p>ENTRENAMIENTOS</p>
        <div className='calender-box'>
            <h3>MASCULINO</h3>
            <h3>Martes: 21:00 hs a 22:30hs</h3>
            <h3>Mi√©rcoles: 22:00 a 23:00hs</h3>
            <h3>Jueves: 21:30hs a 23:00hs</h3>
        </div>
        <div className='calender-box'>
            <h3>FEMENINO</h3>
            <h3>Jueves: 21:00hs a 22:00hs</h3>
        </div>
    </div>
  )
}
